import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, NavLink } from 'react-router-dom';
import Header from './../components/Header';
import Footer from './../components/Footer';
import './../starterstyles.css';

const baseURL = 'https://comp2140.uqcloud.net/api/sample/';

const sampleID = null;

const strSampleID = sampleID.toString();

const APIKEY = 'gdJY8BdnNf';

const url = `${baseURL}${strSampleID}/?api_key=${APIKEY}`;



function SampleShare () {

        const [sharing, setSharing] = useState(true); // true for shared, false for not shared

        // fetch sample data from Django, parsed as json
        useEffect(() => {
            const fetchSample = async() => {
                const APIResponse = await fetch(url); // api?
                const json = await APIResponse.json();
                setSamples(json);
            };

            // call the async fetchSample function
            fetchSample();
        }, []);

    return (
        <>
            <main>
            <h2 className="title">Share This Sample</h2>

                <div className="card">
                    <div className="song-details">
                        <h3>Sample Name</h3>
                        <p>Date Created</p>
                    </div>
                    <div className="buttons">
                        <a href="#" class="bright-button" >Preview</a>
                    </div>
                </div>

                <div className="toggle-row-container">
                    <div className="location-name-label">
                        <h4>Location 1</h4>
                    </div>
                    <div className="sequence-row-container">
                        <button className="toggle-selected" >Shared</button>
                        <button className="toggle">Not Shared</button>
                    </div>
                </div> 
            </main>
        </>
    );
}

export default SampleShare;
